import './App.css';
import { Route, Router, Routes } from 'react-router-dom';
import BookSearchPage from './pages/BookSearchPage';


function App() {
  return (
  <Router>
    <Routes>
      <Route path='/' element={<BookSearchPage />} />
      <Route path='/bookself' element={<BookshelfPage />} />
    </Routes>
  </Router>
  );
}

export default App;
